import { Route, Routes } from "react-router-dom";
import NoticeDetailComponent from "./NoticeDetailComponent"
import NoticeWriteComponent from "./NoticeWriteComponent"

const RouteList= () =>{
    return(
        <div>
    <Routes>
        <Route path="/noticedetailcomponent" element={<NoticeDetailComponent />}></Route>
        <Route path="/noticewrite" element={<NoticeWriteComponent />}></Route>
    </Routes>
    </div>
    )
}

export default RouteList;
